import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'imgDoc'
})
export class ImgDocPipe implements PipeTransform {

  transform(value: any): string {
    let type:any=value.split('.')[1]

    let res=''

    switch(type){
      case 'pdf':
        res="data:image/png;base64,"
        break;
      case 'xlsx':
        res="data:image/png;base64,"
        break;
      case 'docx':
        res="data:image/png;base64,"
        break;
      case ('jpg' || 'png' || 'jpeg' || 'JPG' || 'JPEG') :
        res="data:image/png;base64,"
        break;
      case 'txt':
        res="data:image/png;base64,"
        break;
      default:
        res="data:image/png;base64,"
        break;
    }
    return res;
  }

}
